import './App.css'
import React, { Component } from "react";
import { CardColumns, Card } from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.min.css';

export default class DisplayList extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
        };

    }

    makeCard = item => {
        return (
            <Card>
                <CardMedia>

                </CardMedia>
                <Card.Img variant="left" src={process.env.PUBLIC_URL + '/HIP.jpg'} alt={item.title} />
                <Card.Body>
                    <Card.Title>{item.title}</Card.Title>
                    <Card.Text>
                        Artist: {item.artist}
                    </Card.Text>
                    <Card.Text>
                        Language: {item.language}
                    </Card.Text>
                    <Card.Text>
                        Singer: {item.singer}
                    </Card.Text>
                </Card.Body>
                <Card.Footer>
                    <small className="text-muted">Duration: {Math.floor(item.duration / 60)}:{item.duration % 60}</small>
                </Card.Footer>
            </Card>
        )
    }

    render() {
        return (
            <div>
                <CardColumns>
                    {this.props.list.map(item => { return this.makeCard(item) })}
                </CardColumns>
            </div>
        )
    }
}
